import React, {useEffect} from 'react';
import { useSelector } from 'react-redux';
import './disk.css'
const currentDir = useSelector(state => state.files.currentDir)
useEffect(
    () => {
        dispatch(getFiles(currentDir))
    },
    [currentDir]
)
const Disk = () => {
    return (
            <div className = "disk"> Disk
        </div>
    );
};
export default Disk;
